const Cart = () => {

    return (  
        <div>
            <header className="continue shopping">
                <img src="./images/arrow.png" alt="arrow" className="arrow-icon" />
                <h3>Continue Shopping</h3>

            </header>
        </div>
    );
}
 
export default Cart;
